  false,\n\t\"url\": null,\n\t\"notes\": \"These data delineate Rockfish Conservation
  Areas (RCA) off the West Coast of the United States for 2015. There are three types
  of areas closures depicted in this layer: Commercial Trawl Non-Groundfish, Commercial
  Trawl Groundfish, and Commercial Non-Trawl Groundfish. These areas represent closures
  to commercial fishing for non-groundfish with trawl gear, closed to commercial fishing
  for groundfish with trawl gear, or areas are closed to commercial fishing for groundfish
  with non-trawl gear, respectively. Closures may vary seasonally. Boundaries are
  lines that connect a series of coordinates that approximate particular depth contours.
  North/south boundaries are designated by specific lines of latitude. Keep in mind
  that Rockfish Management Areas are fairly dynamic and may change as often as 5 times
  per year. See the Source Info link for the latest information.\",\n\t\"license_title\":
